INSERT INTO posts(name,text,likes,comment_nums)
VALUES ('Седина в шерсти','Добрый день! Недавно заметила, что у собакена появилась седина над глазами. Меня это беспокоит, тк ему в этом году только 5 лет, у прошлых 3х собак седина появилась ближе к 10-12 годам, а у этого так рано(Это у него такой ранний естественный процесс пошел или стоит обратить более пристальное внимание на его здоровье?',10,4);

INSERT INTO posts(name,text,likes,comment_nums)
VALUES ('Кошачий аппетит','У меня недавно появились два котенка. У них в мисках всегда есть свой сухой корм, по вечерам даю влажный. НО они жрут все подряд!!! Они у детей каши отбирают, голубцы воруют... Мой чай допили. Я в шоке! Чего им не хватает??? Кроме люлей.',11,3);

INSERT INTO posts(name,text,likes,comment_nums)
VALUES ('Лечим попугая','Женька пугает мужа.Муж высокий и когда он проходит мимо, она вскидывает крылья "я выше, я сильнее". Муж смеется и в ответ вскидывает руки. Так и живем.Вчера, пока они друг на друга руки и крылья поднимали, муж увидел на боку у Женьки проплешину. Под крылом. Дыра, свободная от перьев, сквозь которую видно значительную часть тела попугайского.Непопугаеводам неочевидно, но с птицами тяжело попасть в ветклинику. Женька воспитана по заветам не гладить и не делать ручной, чтобы не ломать психику. Я могу ее взять и переместить в пространстве на палке, она любит ко мне прилетать и в легкую по мне ходит. Но руками - нет. Я не смогу вынуть ее у врача из клетки, поднять ей крыло и показать дыру. К тому же для начала нужен врач. А их мало.Я позвонила в клинику, которая лечит только птиц. Мне ответил мужчина с очень сильно нетрезвым голосом. Возможно, голос был просто сильно невыспавшийся. Мне остается только надеятся. Муж ухохотался, подслушивая. Я решила во что бы то ни стало получить консультацию онлайн. Состояние врача вставало на десятое место. Я перевела некоему Ивану Ивановичу 3 тр и ждала ответа по вотс апп часа 2. Через какое-то время Иван Иванович все-таки раздал мне советов.Купить лекарство Радостин. От стресса, что понятно по названию.',109,3);

